Now in reality, once most developers become adept at using the Aggregation Framework, they tend not to rely on temporary intermediate collections whilst prototyping each stage, although it is still a valid development approach if you prefer it. Instead, seasoned aggregation pipelines developers typically just comment out one or more stages of an aggregation pipeline when using the Mongo Shell (or use the 'disable stage' capability provided by the GUI tools for MongoDB). Some of the principles to strive for, to encourage composability and hence productivity, are: Easy disabling of subsets of stages, whilst prototyping Easy addition of new fields to a stage or new stages to a pipeline by performing a copy, a paste and then a modification, without hitting cryptic error messages which result from issues like missing out a comma before the newly added item Easy appreciation, at a glance, of each distinct stage its purpose With these principles in mind, the following is an opinionated list of guidelines for the way you should textually craft your pipelines in JavaScript, to improve your pace of pipeline development. Don't start or end a stage on the same line as another stage For every field in a stage, and for every stage in a pipeline, include a trailing comma even if it is currently the last item Include an empty newline between every stage For complex stages include a // comment with an explanation, on a newline, before the stage To 'disable' some stages of a pipeline whilst prototyping another stage, just use the multi-line comment /* prefix and */ suffix Below is an example of a poor pipeline layout, where none of the guiding principles have been followed: // BAD var pipeline = [ {'$unset': [ '_id', 'address' ]}, {'$match': { 'dateofbirth': {'$gte': ISODate('1970-01-01T00:00:00Z')} }}//, {'$sort': { // 'dateofbirth': -1 //}}, {'$limit': 2} */
]; Whereas the following is an example of far better pipeline layout, where all of the guiding principles have been followed: // GOOD var pipeline = [ {'$unset': [ '_id', 'address', ]}, // Only match people born on or after 1st Janurary 1970 {'$match': { 'dateofbirth': {'$gte': ISODate('1970-01-01T00:00:00Z')}, }}, /* {'$sort': { 'dateofbirth': -1, }}, {'$limit': 2}, */
]; Notice trailing commas are included above, at both the end of stage and end of field levels. It is also worth mentioning that some (but not all) developers take a slightly different but equally valid approach to constructing a pipeline. They decompose each stage in the pipeline into different JavaScript variables, where each stage variable is defined separately, as show in the example below: // GOOD var unsetStage = { '$unset': [ '_id', 'address', ]}; var matchStage = { '$match': { 'dateofbirth': {'$gte': ISODate('1970-01-01T00:00:00Z')}, }}; var sortStage = { '$sort': { 'dateofbirth': -1, }}; var limitStage = {'$limit': 2}; var pipeline = [ unsetStage, matchStage, sortStage, limitStage,
]; This book is not advocating this 'multi-variable' approach over a 'single-variable' approach to defining a pipeline. It is just highlighting another highly composable option. Ultimately it is a personal choice about which you find most comfortable and productive. Indeed, some developers will go a step further, if not intending to transfer the prototyped pipeline to another programming language in their target application code. They will factor out complex boilerplate parts of their pipeline into separate JavaScript functions, which can be re-used from multiple places in their main JavaScript based pipeline.

