$set & $unset stages should be used when most of the fields in the input records should be retained and only a minority subset of fields need to be added, modified or removed. This is the case for the majority of uses of aggregation pipelines. For example, imagine there is a collection of credit card payment records as documents similar to the following: // INPUT (a record from the source collection to be operated on by an aggregation)
{ _id: ObjectId("6044faa70b2c21f8705d8954"), card_name: 'Mrs. Jane A. Doe', card_num: '1234567890123456', card_expiry: '2023-08-31T23:59:59.736Z', card_sec_code: '123', card_provider_name: 'Credit MasterCard Gold', transaction_id: 'eb1bd77836e8713656d9bf2debba8900', transaction_date: 2021-01-13T09:32:07.000Z, transaction_curncy_code: 'GBP', transaction_amount: Decimal128("501.98"), reported: true
} Then imagine an aggregation pipeline is required, to produce modified versions of the documents, as shown below: // OUTPUT (a record in the results of the executed aggregation)
{ card_name: 'Mrs. Jane A. Doe', card_num: '1234567890123456', card_expiry: 2023-08-31T23:59:59.736Z, // Field type converted from text to date card_sec_code: '123', card_provider_name: 'Credit MasterCard Gold', transaction_id: 'eb1bd77836e8713656d9bf2debba8900', transaction_date: 2021-01-13T09:32:07.000Z, transaction_curncy_code: 'GBP', transaction_amount: Decimal128("501.98"), reported: true, card_type: 'CREDIT' // New field added using a literal value
} Here, shown by the // comments, there was a requirement to slightly modify the structure of each document, converting the card_expiry text field into a proper date field, and adding a new field card_type field, set to a value of 'CREDIT', for every record. Naively you might decide to build an aggregation pipeline using a $project stage, to achieve this transformation, which would probably look similar to the following: // BAD
[ {'$project': { // Modify a field + add a new field 'card_expiry': {'$dateFromString': {'dateString': '$card_expiry'}}, 'card_type': 'CREDIT', // Must now name all the other fields for those fields to be retained 'card_name': 1, 'card_num': 1, 'card_sec_code': 1, 'card_provider_name': 1, 'transaction_id': 1, 'transaction_date': 1, 'transaction_curncy_code': 1, 'transaction_amount': 1, 'reported': 1, // Remove _id field '_id': 0, }},
] As you can see, the pipeline's stage is quite verbose and because a $project stage is being used to modify/add two fields, you are forced to also explicitly name each other existing field of the source records, for inclusion, otherwise that information will be lost during the transformation. Imagine if each payment document has hundreds of possible fields, rather than just ten! A better approach to building the aggregation pipeline, to achieve the exact same results, would be to use $set and $unset instead, as shown below: // GOOD
[ {'$set': { // Modified + new field 'card_expiry': {'$dateFromString': {'dateString': '$card_expiry'}}, 'card_type': 'CREDIT', }}, {'$unset': [ // Remove _id field '_id', ]},
] This time, if some new documents are subsequently added to the existing payments collection, which include additional new fields, e.g. settlement_date & settlement_curncy_code', then no changes are required to the aggregation pipeline to allow these new fields to automatically appear in the existing aggregation pipeline's results. However, when using $project, each time the possibility of a new field arises, a developer has to first refactor the pipeline to incorporate an additional inclusion declaration (e.g. 'settlement_date': 1, 'settlement_curncy_code': 1)

