A $project stage should be used when the required output shape of result documents is very different than the shape of input documents, where most of the original fields are not to be included in the output. This time for the same input payments collection, lets imagine a different aggregation pipeline was required to produce result documents, where each document's structure is required to be very different than the input structure, with far fewer field values need to be pulled through from the original input documents, similar to the following: // OUTPUT (a record in the results of the executed aggregation)
{ transaction_info: { date: 2021-01-13T09:32:07.000Z, amount: Decimal128("501.98") }, status: 'REPORTED'
} Now, using $set/$unset in the pipeline to achieve the above output structure would be verbose and would require naming all the fields (for exclusion this time). as shown below: // BAD
[ {'$set': { 'transaction_info.date': '$transaction_date', 'transaction_info.amount': '$transaction_amount', 'status': {'$cond': {'if': '$reported', 'then': 'REPORTED', 'else': 'UNREPORTED'}}, }}, {'$unset': [ // Remove _id field '_id', // Must name all existing fields to be omitted 'card_name', 'card_num', 'card_expiry', 'card_sec_code', 'card_provider_name', 'transaction_id', 'transaction_date', 'transaction_curncy_code', 'transaction_amount', 'reported', ]}, ] However, by using $project for this specific aggregation, as shown below, to achieve the exact same results, the pipeline would be less verbose and have the flexibility of not requiring modification if subsequent additions are ever made to the data model, with new previously unknown fields: // GOOD
[ {'$project': { 'transaction_info.date': '$transaction_date', 'transaction_info.amount': '$transaction_amount', 'status': {'$cond': {'if': '$reported', 'then': 'REPORTED', 'else': 'UNREPORTED'}}, // Remove _id field '_id': 0, }},
]

