As an example, let's assume there is a data-set of information on people (e.g. a collection called persons with a descending index defined on a date of birth field). The following aggregation pipeline may have then been built to show the three youngest people in the collection, only for people born on or after 1970 (so there may be less than 3 records in the result if nearly all people were born before 1970): var pipeline = [ {'$unset' : [ '_id', 'address', 'person_id' ]}, {'$sort' : { 'dateofbirth' : -1 }}, {'$match' : { 'dateofbirth' : {'$gte' : ISODate('1970-01-01T00:00:00Z')} }}, {'$limit' : 3}
] Then the query planner part of the explain plan might be required: db.persons.explain('queryPlanner').aggregate(pipeline); The query plan results for this pipeline shows the following (some less relevant information has been edited out for brevity) "stages" : [ {"$cursor" : { "queryPlanner" : { "parsedQuery" : { "dateofbirth" : { "$gte" : ISODate("1970-01-01T00:00:00Z") } }, "winningPlan" : { "stage" : "FETCH", "inputStage" : { "stage" : "IXSCAN", "keyPattern" : { "dateofbirth" : -1 }, "indexName" : "dateofbirth_-1", "direction" : "forward", "indexBounds" : { "dateofbirth" : [ "[new Date(9223372036854775807), new Date(0)]" ] } } } } }}, {"$project" : { "_id" : false, "person_id" : false, "address" : false } }, {"$sort" : { "sortKey" : { "dateofbirth" : -1 }, "limit" : NumberLong(3) } }
] There are some interesting insights that can be deduced from this query plan: To optimise the aggregation, the database engine has reordered the pipeline and moved the filter from the $match to the top of the pipeline, without changing the functional behaviour or outcome of the pipeline. To optimise the aggregation, the database engine has been able to collapse the $sort and $limit into a single special internal stage which can perform both actions in one go In this case, the aggregation engine only has to track in memory the 3 currently known youngest person records at any point in time, during the sorting process, rather than holding the whole data set being sorted in memory, which may otherwise be resource prohibitive. The first stage of the executed internal runtime version of the pipeline, regardless of what ordered stages were placed in the pipeline by the developer, is always an internal $cusror stage. The $cursor runtime stage is the first thing that happens for any executing aggregation. The aggregation engine re-uses the MQL query engine to perform a 'regular' query against the collection, optionally including a filter based on the contents of the aggregation's $match, if a $match was defined and occurs early in the optimised pipeline. The aggregation runtime uses the resulting query cursor to pull batches of records at a time, just like a client application using a MongoDB driver would do when remotely invoking an MQL query against a database collection. As with a normal MQL query, the regular database query engine will try to use an index if it makes sense (which it does in this case, as is visible in the embedded $queryPlanner metadata, showing the "stage" : "IXSCAN", element and the index used, "indexName" : "dateofbirth_-1"). Then the execution stats part of the explain plan might then be asked for: db.persons.explain('executionStats').aggregate(pipeline); Below is a redacted example of the resulting execution statistics in the explain plan, highlighting some of the most important metadata elements that developers should typically focus on. "executionStats" : { "nReturned" : 333333, "totalKeysExamined" : 333333, "totalDocsExamined" : 333333, ... "executionStages" : { "stage" : "FETCH", "nReturned" : 333333, "docsExamined" : 333333, ... "inputStage" : { "stage" : "IXSCAN", "nReturned" : 333333, "indexName" : "dateofbirth_-1", "direction" : "forward", "keysExamined" : 333333, ...
} Here the plan shows that an index was used, and because 'index keys examined' and 'documents examined' match, this indicates that the index was fully leveraged to completely identify the required records, which is good news. This doesn't necessarily mean the aggregation is fully optimal though. For example, if there was the need to reduce latency further, some analysis could be done to determine if the the index can completely cover the query . If the cursor query part of the the aggregation is satisfied entirely using the index and does not have to examine any documents, you would see totalDocsExamined = 0 in the resulting explain plan. The critical information shown in executionStats is similar to the normal MQL explain plan returned for a regular find() operation, and similar principles apply for spotting things like has the optimum index been used, and does the data model lend itself to efficiently processing the query?

