Sometimes it is necessary to transform documents from a source collection that each include an array field, where the main purpose of the aggregation pipeline is just to reduce the content of each array, in isolation, but in the same way. For example, the aggregation may just need to add together all the values of the array into a total, or retain the first or last element of the array only, or retain only one field from the sub-document that is in each array element, or any one of numerous other array reduction scenarios. Bringing this to life more, imagine there is a product_orders collection where each document in the collection represents a product, and the list of orders is an array of elements against each product, as shown in the example below: [ { name: 'Asus Laptop', orders: [ { customer_id: 'elise_smith@myemail.com', orderdate: 2020-05-30T08:35:52.000Z, value: Decimal128("431.43") }, { customer_id: 'jjones@tepidmail.com', orderdate: 2020-12-26T08:55:46.000Z, value: Decimal128("429.65") } ] }, { name: 'Morphy Richards Food Mixer', orders: [ { customer_id: 'oranieri@warmmail.com', orderdate: 2020-01-01T08:25:37.000Z, value: Decimal128("63.13") } ] }
] Let's say that an aggregation is required to transform these documents to only include the customer_id in each order for each product, and to exclude the orderdate and value fields because they are surplus to requirements. The desired aggregation output might be: [ { name: 'Asus Laptop', orders: [ 'elise_smith@myemail.com', 'jjones@tepidmail.com' ] }, { name: 'Morphy Richards Food Mixer', orders: [ 'oranieri@warmmail.com' ] }
] One obvious way of achieving this transformation in an aggregation pipeline is to unwind the orders array for each record, producing an intermediate set of individual order records, and then group together again the orders records by product $name but only pushing the customer_id field back into the orders array and ignoring the orderdate and value fields. The required pipeline to achieve this is shown below: // SUBOPTIMAL var pipeline = [ {'$unwind': { 'path': '$orders', }}, {'$group': { '_id': '$name', 'orders': {'$push': '$orders.customer_id'}, }},
]; However, the pipeline is suboptimal because a $group stage has been introduced, which, as outlined earlier in this chapter, is a blocking stage. This will potentially increase memory consumption significantly and hence the execution time dramatically, if run against a large data-set. There is a far better alternative, which is to use one of the Array Operators instead. Array Operators are sometimes less intuitive to code, but critically, they avoid requiring the need to introduce a blocking stage into the pipeline. As a consequence they are significantly more optimal, especially for large data-sets. Shown below is a far more efficient pipeline, using the $map array operator, rather then the $unwind/$group combination, to produce the same outcome: // OPTIMAL var pipeline = [ {'$set': { 'orders': { '$map': { 'input': '$orders', 'as': 'order', 'in': '$$order.customer_id', } }, }},
]; There should never be the need to use an $unwind/$group combination in an aggregation pipeline just to transform an array of elements contained in each document. Instead, use Array Operators to avoid introducing a blocking stage, which, when a pipeline is handling more than 100MB of in-flight data will result in magnitudes of reduction in execution time. It may even mean the difference between being able to achieve the required business outcome, using an aggregation, versus having to abandon the whole task as being unachievable. In summary, the primary use of an $unwind/$group combination is to correlate patterns across many records, rather than transform the content inside each input record in isolation. An example of an appropriate use of $unwind/$group is shown in this book's Unpack Array & Group Differently example.

